function buildDatatable(data) {
    
    tableHtml = '<table id="rankings-table" class="table-responsive stripe hover" style="width:100%"><thead><tr><th>Overall Rank</th><th>Region</th><th>Skills Rank</th><th>Adoption Rank</th><th>Infrastructure Rank</th><th>R&D Rank</th><th>F&I Rank</th><th>Trade Rank</th></tr></thead><tbody>';
    for (let i = 0; i < data.length; i++){
        tableHtml += `<tr><td>${i + 1}</td><td>${data[i].region}</td>`
        allMetrics.forEach((k)=>{
            if (!selectedMetrics.includes(k)) {
                tableHtml += `<td>${data[i][k]}</td>`
            }
        });
        tableHtml += '</tr>'
    }
    tableHtml += '</tbody></table>'
    $("#main-panel").html(tableHtml);

    var rankingsTable = $('#rankings-table').DataTable({
        pageLength: 12,
        searching: false,
        lengthChange: false,
        info: false,
        paging: true,
        destroy: true
    });    
}

function getHeatmapColour (v){
    const colorScale = d3.scaleLinear().domain(d3.extent([1,41])).range(['white','blue'])
    return colorScale(v)
}

function getRankOrdinal (regionName){
    nuts2data.forEach((r)=>{
        if (r.region == regionName){
            return r.overallRank/nuts2data.length
        }
    })
    return null
}

function buildSVGText (regions=[]) {
    svgText = '<svg xmlns="http://www.w3.org/2000/svg" width="700" height="600" stroke="#000" fill="#fff" stroke-width=".98" xmlns:v="https://vecta.io/nano" viewBox="0 0 700 600" style="transform: translate3d(10%, -1%, 0px);">';
    if (regions.length == 0){
        allRegionsSVGs.forEach((r)=>{
            for(let n in r){
                const rankOrdinal = getRankOrdinal(n);
                const fillColour = getHeatmapColour(rankOrdinal);
                const id = n.replace(" ", "").replace(",", "").replace("-", "");
                let newAtt = r[n];
                if (newAtt.includes("<g>")){
                    newAtt.replace("<g>", `<g fill="${fillColour}" id="#${id}">`);
                } else {
                    newAtt.replace("<path>", `<path fill="${fillColour}" id="#${id}">`);
                }
                svgText += newAtt;
            }
        });
    }

    svgText += '</svg>';
    return svgText
}

function generateMap (svgText = buildSVGText()){
    $('#heatmap').append(svgText);
}

function updateMainPanel() {		
    let all_data = selectedLevel == 2 ? nuts2data : nuts1data;
    if (selectedRegions.length == 0){
        data = all_data;
    } else {
        data = []
        all_data.forEach(function(r){
            if (selectedRegions.includes(r.region)) {
                data.push(r);
            }
        })
    }
    data = calculateFilteredRanks(data)
    html = ""
    for (let i = 0; i < data.length; i++){
        html += `<li>${i+1}: ${data[i].region}</li>`
    }
    //$('#test-list').html(html)
    buildDatatable(data)

}

